import './style.css';
import InputField from '../form-fields/InputField';
import { useState } from 'react';

const ItemOptions = () => {
  return (
    <div className="item-options">
      <InputField
        label="Tracked"
        type="checkbox"
        inputName="tracked"
        value={tracked}
        onChange={onChange}
      />
      <InputField
        label="Expected price"
        type="text"
        inputName="expectedPrice"
        value={expectedPrice}
        onChange={onChange}
      />
    </div>
  );
};

export default ItemOptions;
